// File: contracts/art-work/ArtworkTimeProof.sol

// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

contract ArtworkTimeProof {

    event ArtworkAdded
    (
        address indexed user,
        string name,
        string indexed hash,
        uint timestamp
    );


    struct Artwork {
        string name;
        string description;
        string author;
        string hash;
        uint256 timestamp;
        string locationUri;
    }

    mapping(address => Artwork[]) public address2artwork;

    function addArtwork(
        string memory _name,
        string memory _description,
        string memory _author,
        string memory _hash,
        string memory _locationUri
    ) external {
        Artwork memory newArtwork = Artwork({
            name: _name,
            description: _description,
            author: _author,
            hash: _hash,
            timestamp: block.timestamp,
            locationUri: _locationUri
        });
        address2artwork[msg.sender].push(newArtwork);
        emit ArtworkAdded(msg.sender, _name, _hash, block.timestamp);
    }

    function getArtworkCount(address user) external view returns (uint256) {
        return address2artwork[user].length;
    }

    function getArtwork(address user, uint256 index) external view returns (Artwork memory) {
        return address2artwork[user][index];
    }

    function setLocationUri(uint256 index, string memory _locationUri) external {
        address2artwork[msg.sender][index].locationUri = _locationUri;
    }

}
